// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

contract StringUtil {
    function stringToBytes32(string memory _str) public pure returns (bytes32) {
        bytes32 result;
        assembly {
            result := mload(add(_str, 32))
        }
        return result;
    }

    uint private nonce;

    function generateUniqueActorAddress() public returns (address) {
        uint random = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, nonce)));
        nonce++;

        // Generate the address within the valid address range
        address actorAddress = address(uint160(uint256(random)));

        // Ensure the generated address is unique
        while (addressExists(actorAddress)) {
            random = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, nonce)));
            nonce++;
            actorAddress = address(uint160(uint256(random)));
        }

        return actorAddress;
    }

    function addressExists(address _address) private view returns (bool) {
        uint size;
        assembly {
            size := extcodesize(_address)
        }
        return size > 0;
    }
}

